import { BrowserRouter as Router, Switch, Route, navLink } from "react-router-dom";
import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import HostelBook from "./HostelBook";
import ViewAll from "./ViewAll";
import "./App.css";

const App = () => {
  return (
    <>
      <Router>
        <div className="header">
          <span className="Link2" ><navLink to="/" activeClassName>Home</navLink></span>
          <span className="head"> Hostel Management System</span>
          <span className="Link1"><navLink to="/register" >Registration</navLink></span>
          <span className="Link1"> <navLink to="/login">Login</navLink></span>
          <span className="Link1"> <navLink to="/bookhostel">Book Hostel</navLink></span>
          <span className="Link1"><navLink to="/viewall">All Student</navLink></span>
          <span className="Link1"><navLink>Logout</navLink></span>
        </div>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/register">
            <Registration />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/bookhostel">
            <HostelBook />
          </Route>
          <Route path="/viewall">
            <ViewAll />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
